    "column_name": "{href=null, type=text, annotations={code=false, strikethrough=false, color=default, italic=false, bold=true, underline=false}, plain_text=PO – Phân phối (Thương mại / Sản xuất), text={link=null, content=PO – Phân phối (Thương mại / Sản xuất)}}",
    "content_text": "1. Đơn vị PHẢI hoạt động theo mô hình phân phối B2B (distributor, nhà phân phối, nhà sản xuất kiêm phân phối).\n2. Khách hàng cuối PHẢI là một trong các nhóm sau:\n- Cửa hàng bán lẻ, siêu thị, minimart.\n- Nhà hàng, quán ăn, điểm tiêu thụ F&B.\n- Doanh nghiệp, tổ chức, hoặc distributor cấp dưới.\n3. Các đặc điểm pháp lý sau thường xuất hiện ở đơn vị phân phối B2B và được sử dụng như dấu hiệu nhận diện khách phân phối (PO):\n- Giấy phép kinh doanh ngành nghề phù hợp với nhóm sản phẩm phân phối.\n- Hồ sơ chứng minh nguồn gốc xuất xứ sản phẩm (hợp đồng mua bán, hóa đơn, C/O (Giấy chứng nhận xuất xứ hàng hóa), phiếu kiểm nghiệm, v.v.).\n- Trường hợp là đơn vị sản xuất kiêm phân phối: sản phẩm PHẢI hoàn tất thủ tục công bố với cơ quan quản lý (Sở Công Thương/Sở Y Tế...)\n",
    "content_html": "1. Đơn vị <strong>PHẢI</strong> hoạt động theo mô hình <strong>phân phối B2B</strong> (distributor, nhà phân phối, nhà sản xuất kiêm phân phối).\n2. Khách hàng cuối <strong>PHẢI</strong> là một trong các nhóm sau:\n- Cửa hàng bán lẻ, siêu thị, minimart.\n- Nhà hàng, quán ăn, điểm tiêu thụ F&B.\n- Doanh nghiệp, tổ chức, hoặc distributor cấp dưới.\n3. Các đặc điểm pháp lý sau <strong>thường xuất hiện ở đơn vị phân phối B2B</strong> và được sử dụng như <strong>dấu hiệu nhận diện khách phân phối (PO)</strong>:\n- Giấy phép kinh doanh ngành nghề phù hợp với nhóm sản phẩm phân phối.\n- Hồ sơ chứng minh nguồn gốc xuất xứ sản phẩm (hợp đồng mua bán, hóa đơn, C/O (Giấy chứng nhận xuất xứ hàng hóa), phiếu kiểm nghiệm, v.v.).\n- Trường hợp là <strong>đơn vị sản xuất kiêm phân phối</strong>: sản phẩm <strong>PHẢI</strong> hoàn tất thủ tục công bố với cơ quan quản lý (Sở Công Thương/Sở Y Tế...)\n"
