    "content_text": "1. Hoạt động chính là bán online/bán sỉ/bán lẻ, trong đó khách hàng cuối CHỦ YẾU là người tiêu dùng hoặc các shop/đại lý nhỏ.\n2. Đơn vị CÓ THỂ có hoặc chưa có đăng ký kinh doanh; hồ sơ sản phẩm KHÔNG ĐƯỢC QUẢN LÝ TẬP TRUNG tại đơn vị vận hành.\n3. Thông tin sản phẩm trên kênh bán DO SHOP TỰ KHAI BÁO, không có bộ hồ sơ chuẩn dùng làm căn cứ vận hành như kênh phân phối B2B.",
    "content_html": "1. Hoạt động chính là <strong>bán online/bán sỉ/bán lẻ</strong>, trong đó khách hàng cuối <strong>CHỦ YẾU</strong> là người tiêu dùng hoặc các shop/đại lý nhỏ.\n2. Đơn vị <strong>CÓ THỂ</strong> có hoặc chưa có đăng ký kinh doanh; hồ sơ sản phẩm <strong>KHÔNG ĐƯỢC QUẢN LÝ TẬP TRUNG</strong> tại đơn vị vận hành.\n3. Thông tin sản phẩm trên kênh bán <strong>DO SHOP TỰ KHAI BÁO</strong>, không có bộ hồ sơ chuẩn dùng làm căn cứ vận hành như kênh phân phối B2B."
