    "content_text": "1. Sản phẩm thuộc kênh phân phối chính thống, đã hoặc đang được khách hàng thực hiện đầy đủ các nghĩa vụ pháp lý theo quy định ngành hàng (công bố, kiểm nghiệm, ghi nhãn…).\n2. Sản phẩm PHẢI có quy cách đóng gói chuẩn hoá, bao gồm tối thiểu:\n- Thùng/kiện tiêu chuẩn.\n- Số lượng chuẩn trên mỗi thùng/kiện.\n- Trọng lượng chuẩn hoặc khoảng trọng lượng được quy định trước.\n3. Bao bì sản phẩm PHẢI có tem nhãn đầy đủ, bao gồm:\n- Tên sản phẩm, thành phần, định lượng.\n- Ngày sản xuất (NSX), hạn sử dụng (HSD).\n- Batch/lot, điều kiện bảo quản, cảnh báo (nếu có).\n4. Hệ thống vận hành PHẢI sử dụng được bộ mã sản phẩm sau:\n- Mã SKU, mã thùng, mã lô/batch.\n- Ưu tiên có barcode/QR để scan theo thùng/pallet.\n5. Yêu cầu bảo quản sản phẩm PHẢI được quy định rõ ràng (ví dụ: FMCG, thực phẩm khô, hàng dễ vỡ, hàng cần giữ lạnh...).\n",
    "content_html": "1. Sản phẩm <strong>thuộc kênh phân phối chính thống</strong>, đã hoặc đang được khách hàng thực hiện đầy đủ các nghĩa vụ pháp lý theo quy định ngành hàng (công bố, kiểm nghiệm, ghi nhãn…).\n2. Sản phẩm <strong>PHẢI</strong> có <strong>quy cách đóng gói chuẩn hoá</strong>, bao gồm tối thiểu:\n- Thùng/kiện tiêu chuẩn.\n- Số lượng chuẩn trên mỗi thùng/kiện.\n- Trọng lượng chuẩn hoặc khoảng trọng lượng được quy định trước.\n3. Bao bì sản phẩm <strong>PHẢI</strong> có tem nhãn đầy đủ, bao gồm:\n- Tên sản phẩm, thành phần, định lượng.\n- Ngày sản xuất (NSX), hạn sử dụng (HSD).\n- Batch/lot, điều kiện bảo quản, cảnh báo (nếu có).\n4. Hệ thống vận hành <strong>PHẢI</strong> sử dụng được bộ mã sản phẩm sau:\n- Mã SKU, mã thùng, mã lô/batch.\n- Ưu tiên có barcode/QR để scan theo thùng/pallet.\n5. Yêu cầu bảo quản sản phẩm <strong>PHẢI</strong> được quy định rõ ràng (ví dụ: FMCG, thực phẩm khô, hàng dễ vỡ, hàng cần giữ lạnh...).\n"
