    "content_text": "📌 Shop đăng đơn kèm phiếu tạm:\nCách 1: Click vào Tạo đơn hàng\n - Bước 1: Truy cập vào màn hình đăng đơn, bấm chọn Đăng đơn PO.\n - Bước 2: Chọn phiếu tạm đã tạo.\n * Shop thực hiện đăng nhiều PO hoặc từng PO một\n  + TH1 : Chọn thủ công từng PO\n  • Shop bấm vào ô Chọn PO và chọn phiếu mong muốn → hệ thống tự động  điền các thông tin của PO vào đơn hàng.\n  + TH2 : Chọn nhiều PO.\n  • Shop bấm vào mục Danh sách PO → chọn các PO cần đăng và bấm Áp dụng.\n - Bước 3 : Đăng đơn hàng\n  • Sau khi đã fill thông tin PO, shop chọn từng đơn hàng và bấm Đăng đơn\n  • Các đơn hàng sau khi đăng sẽ được link tới PO đã chọn.\nCách 2 : \n- Bước 1 : Chọn phiếu PO tạm\n- Bước 2 : Nhấn chọn Tạo đơn PO\n- Bước 3 : Bổ sung các thông tin yêu cầu để đăng đơn.\n- Bước 4 : Nhấn chọn Đăng ĐH",
    "content_html": "<strong>📌 Shop đăng đơn kèm phiếu tạm:</strong>\n<u><strong>Cách 1:</strong></u> Click vào <code>Tạo đơn hàng</code>\n - Bước 1: Truy cập vào màn hình đăng đơn, bấm chọn <code>Đăng đơn PO</code>.\n - Bước 2: Chọn phiếu tạm đã tạo.\n<em> * Shop thực hiện đăng nhiều PO hoặc từng PO một\n</em>  <span class=\"notion-blue\">+ TH1 :</span> Chọn thủ công từng PO\n  • Shop bấm vào ô <code>Chọn PO</code> và <code>chọn phiếu</code> mong muốn → hệ thống tự động  điền các thông tin của PO vào đơn hàng.\n  <span class=\"notion-blue\">+ TH2 :</span> Chọn nhiều PO.\n  • Shop bấm vào mục <code>Danh sách PO</code> → chọn các PO cần đăng và bấm <code>Áp dụng</code>.\n - Bước 3 : Đăng đơn hàng\n  • Sau khi đã fill thông tin PO, shop chọn từng đơn hàng và bấm <code>Đăng đơn</code>\n  • Các đơn hàng sau khi đăng sẽ được link tới PO đã chọn.\n<u><strong>Cách 2 :</strong></u> \n- Bước 1 : Chọn phiếu PO tạm\n- Bước 2 : Nhấn chọn <code>Tạo đơn PO</code>\n- Bước 3 : Bổ sung các thông tin yêu cầu để đăng đơn.\n- Bước 4 : Nhấn chọn <code>Đăng ĐH</code>"
