    "content_text": "📌 Thao tác trên app :\n- Bước 1: Chọn tính năng Booking xe\n  • Hệ thống hiển thị giao diện tạo Booking.\n- Bước 2: Điền thông tin tạo booking:\n  • Bản đồ : Hiển thị bản đồ với địa chỉ của shop\n  • Kho lấy : Mặc định hiển thị kho lấy mặc định của shop → Click để mở danh sách →. Mở lên bottomsheet danh sách địa chỉ kho lấy của shop.\n  • Thời gian hẹn lấy : Mặc định hiển ca lấy sớm nhất theo tiêu chuẩn của shop. Shop có config hẹn lấy cố định → hiển thị danh sách thời gian hẹn cố định.\n  • Hàng hoá : Mặc định hiển thị hint text. Bấm Chọn → bottomsheet nhập KL, KT hàng hoá\n  • Lưu nháp : Shop Lưu nháp → Tạo ra 1 mã booking nháp với trạng thái Chưa tiếp nhận.\n  • Lưu thông tin : Shop bấm Lưu thông tin → Validate các thông tin bắt buộc → Lưu thông tin thành công → Pop-up \"Tạo booking lấy hàng thành công, Vui lòng kiểm tra trong danh sách booking\" và lưu log \"Đã tạo booking, Đã tiếp nhận booking\"\n* Lưu ý: Các booking phải có thông tin khác nhau, trường thông tin booking trùng với booking đã có ( trừ trường hợp booking cũ đã huỷ hoặc hoàn thành ) → Báo lỗi \"Booking tương tự đã tồn tại và đang ở trạng thái \"\n",
    "content_html": "📌 Thao tác trên app :\n- <u>Bước 1:</u> Chọn tính năng <code>Booking xe</code>\n  • Hệ thống hiển thị giao diện tạo Booking.\n- <u>Bước 2:</u> Điền thông tin tạo booking:\n  • Bản đồ : Hiển thị bản đồ với địa chỉ của shop\n  • Kho lấy : Mặc định hiển thị kho lấy mặc định của shop → <code>Click để mở danh sách</code> →. Mở lên bottomsheet danh sách địa chỉ kho lấy của shop.\n  • Thời gian hẹn lấy : Mặc định hiển ca lấy sớm nhất theo tiêu chuẩn của shop. Shop có config hẹn lấy cố định → hiển thị danh sách <code>thời gian hẹn cố định</code>.\n  • Hàng hoá : Mặc định hiển thị hint text. Bấm Chọn → bottomsheet <code>nhập KL, KT hàng hoá</code>\n  • Lưu nháp : Shop <code>Lưu nháp</code> → Tạo ra 1 mã booking nháp với trạng thái <code>Chưa tiếp nhận</code>.\n  • Lưu thông tin : Shop bấm <code>Lưu thông tin</code> → Validate các thông tin bắt buộc → Lưu thông tin thành công → Pop-up <em>\"Tạo booking lấy hàng thành công, Vui lòng kiểm tra trong danh sách booking\"</em> và lưu log <em>\"Đã tạo booking, Đã tiếp nhận booking\"</em>\n* <u><em>Lưu ý:</em></u><em><strong> </strong></em><em>Các booking phải có thông tin khác nhau, trường thông tin booking trùng với booking đã có ( trừ trường hợp booking cũ đã huỷ hoặc hoàn thành ) → Báo lỗi \"Booking tương tự đã tồn tại và đang ở trạng thái \"</em>\n"
