    "content_text": "📌 Tài xế chọn điểm dừng lấy hàng phân phối để thao tác ( Điểm dừng có gắn nhãn Có hàng phân phối ). PO do hệ thống tự động quét nổ hoặc GSX gán tay cho TX. \n- Bước 1: Tại điểm TX thực hiện kiểm đếm hàng vật lý → Xác nhận lấy hàng → Chốt điểm → Hoàn thành.\n* Lưu ý : Trường hợp tại điểm có phát sinh PO do Shop hoặc Sale tạo thêm → Chọn action KÉO THÊM để kéo PO vào phiên lấy và tiếp tục xử lý.\n- Bước 2: Kiểm tra các \"Dịch vụ gia tăng\" :\n • Nếu shop đăng kí các dịch vụ gia tăng và shop có nhu cầu → Chọn dịch vụ khi tạo PO → TX cần tích chọn đúng, đủ dịch vụ shop mong muốn (các dịch vụ shop luôn đăng ký chọn sẽ được mặc định chọn trên màn hình)\n • Nếu shop không đăng ký các dịch vụ gia tăng → Phần dịch vụ gia tăng sẽ không hiển thị dịch vụ nào\n- Bước 3: Tại màn hình danh sách các phiếu ở ‘trạng thái Tạm thời’ của shop: Chọn PO mong muốn kéo thêm trong danh sách.\n • Sau khi chọn HT fill sẵn thông tin của PO trên form tạo.\n- Bước 4: Kiểm tra lại thông tin sản phẩm trong danh sách khớp với số lượng thực tế được bàn giao\n • Bấm Xác nhận và tạo phiếu.",
    "content_html": "<strong>📌 Tài xế chọn điểm dừng lấy hàng phân phối để thao tác </strong>( Điểm dừng có gắn nhãn <code>Có hàng phân phối</code> ). PO do hệ thống tự động quét nổ hoặc GSX gán tay cho TX. \n- <u><strong>Bước 1:</strong></u> Tại điểm TX thực hiện kiểm đếm hàng vật lý → <code>Xác nhận lấy hàng</code> → <code>Chốt điểm</code> → <code>Hoàn thành</code>.\n* Lưu ý : Trường hợp tại điểm có phát sinh PO do Shop hoặc Sale tạo thêm → Chọn action <code>KÉO THÊM</code> để kéo PO vào phiên lấy và tiếp tục xử lý.\n- <u><strong>Bước 2:</strong></u> Kiểm tra các<em><strong> \"Dịch vụ gia tăng\"</strong></em> :\n • Nếu shop đăng kí các dịch vụ gia tăng và shop có nhu cầu → <code>Chọn dịch vụ</code> khi tạo PO → TX cần tích chọn đúng, đủ dịch vụ shop mong muốn <em>(các dịch vụ shop luôn đăng ký chọn sẽ được mặc định chọn trên màn hình)</em>\n • Nếu shop không đăng ký các dịch vụ gia tăng → Phần dịch vụ gia tăng sẽ không hiển thị dịch vụ nào\n- <u><strong>Bước 3:</strong></u> Tại màn hình danh sách các phiếu ở ‘<em>trạng thái Tạm thời’</em> của shop: <code>Chọn PO</code> mong muốn kéo thêm trong danh sách.\n • Sau khi chọn HT fill sẵn thông tin của PO trên form tạo.\n- <u><strong>Bước 4:</strong></u> Kiểm tra lại thông tin sản phẩm trong danh sách khớp với số lượng thực tế được bàn giao\n • Bấm <code>Xác nhận</code> và tạo phiếu."
