    "content_text": "📦 Vận hành không theo vật chứa:\n - Bước 1: In mã SKU sản phẩm.\n  • Bấm chọn để in mã SKU sản phẩm (Áp dụng trong trường hợp sản phẩm shop bàn giao chưa có mã barcode trên thùng/bao, trường hợp sản phẩm đã có sẵn mã tài xế bỏ qua bước này).\n  • Chọn checkbox Sản phẩm muốn in mã (có thể chọn tất cả sản phẩm trong danh sách) → HT tự động hiển thị ‘số lượng’ của mỗi sản phẩm trong phiếu → cho phép thay đổi số lượng trong trường hợp muốn in ít hơn.\n  • Chọn nút In mã để tiến hành in.\n * Lưu ý: In mã SKU sản phẩm đối với các sản phẩm không có barcode trên thùng/ bao hàng:\n  • Tại màn Lấy hàng: Tài xế chọn button Xem thông tin phiếu → HT hiển thị màn hình chi tiết phiếu.\n  • Tài xế chọn button In mã SKU → HT mở popup cho phép người dùng kết nối với máy in → Tài xế chọn thiết bị in cần kết nối → HT cho phép in các SKU tương ứng với từng sản phẩm.\n  • Tài xế chọn sản phẩm muốn in mã SKU → Tài xế dùng mã đã in để dán lên bao/ thùng SP chưa có mã để xử lý hàng hóa ở các khâu vận hành sau khi lấy thành công.\n - Bước 2: Kiểm tra lại thông tin sản phẩm trong danh sách khớp với số lượng thực tế được bàn giao → Bấm Xác nhận và tạo phiếu\n - Bước 3: Tài xế kéo phiếu & Update thông tin phiếu mới thành công → Lấy hàng đúng đủ số lượng trên PO.",
    "content_html": "📦 <strong>Vận hành không theo vật chứa:</strong>\n - <u><strong>Bước 1:</strong></u> In mã SKU sản phẩm.\n  • Bấm chọn để <code>in mã SKU sản phẩm</code> <em>(Áp dụng trong trường hợp sản phẩm shop bàn giao chưa có mã barcode trên thùng/bao, trường hợp sản phẩm đã có sẵn mã tài xế bỏ qua bước này)</em>.\n  • Chọn checkbox <code>Sản phẩm</code> muốn in mã <em>(có thể chọn tất cả sản phẩm trong danh sách)</em> → HT tự động hiển thị ‘<em>số lượng’</em> của mỗi sản phẩm trong phiếu → cho phép thay đổi số lượng trong trường hợp muốn in ít hơn.\n  • Chọn nút <code>In mã</code> để tiến hành in.\n * <u><em>Lưu ý:</em></u><em> In mã SKU sản phẩm đối với các sản phẩm không có barcode trên thùng/ bao hàng:</em>\n  • Tại màn <code>Lấy hàng</code>: Tài xế chọn button <code>Xem thông tin phiếu</code> → HT hiển thị màn hình chi tiết phiếu.\n  • Tài xế chọn button <code>In mã SKU</code> → HT mở popup cho phép người dùng kết nối với <code>máy in</code> → Tài xế chọn <code>thiết bị in</code> cần kết nối → HT cho phép in các SKU tương ứng với từng sản phẩm.\n  • Tài xế chọn <code>sản phẩm</code> muốn in mã SKU → Tài xế dùng mã đã in để dán lên bao/ thùng SP chưa có mã để xử lý hàng hóa ở các khâu vận hành sau khi lấy thành công.\n - <u><strong>Bước 2:</strong></u> Kiểm tra lại thông tin sản phẩm trong danh sách khớp với số lượng thực tế được bàn giao → Bấm <code>Xác nhận</code> và <code>tạo phiếu</code>\n - <u><strong>Bước 3:</strong></u> Tài xế <code>kéo phiếu</code> & <code>Update thông tin</code> phiếu mới thành công → Lấy hàng đúng đủ số lượng trên PO."
