    "content_text": "🕋 Vận hành theo vật chứa :\n - Bước 1: Sau khi tạo PO thành công → TX thao tác in ‘mã Pallet’ bằng cách click chọn In mã Pallet.\n - Bước 2: Chọn loại mã cần in.\n  + Pallet của khách hàng:\n   • TX chọn Mã Pallet đối tác và nhập số lượng.\n  + Pallet G ( GHTK ):\n   • TX chọn Mã Pallet của GHTK → Chọn mã pallet từ danh sách.\n* Lưu ý :  Dùng pallet của đối tác khi đối tác bàn giao hàng hóa kèm cả pallet. Dùng của GHTK khi đối tác có nhu cầu vận chuyển và gia cố nhưng không có pallet.\n - Bước 3: Gán Sản phẩm lên pallet:\n   • Chọn Gán Pallet → Chọn PO cần gán → Chọn Sản Phẩm cần gán vào pallet ( Có thể chọn tất cả ) → Scan mã pallet → Nhập SL gán → Chọn Xác nhận → popup Gán pallet thành công → Ok\n* Lưu ý: Thao tác Gán Pallet có thể thực hiện tại điểm lấy hàng (bởi TX , người hỗ trợ TX) hoặc tại Hub (bởi XLHH) , tuỳ vào vận hành thực tế.\n - Bước 4: Kiểm tra lại thông tin sản phẩm trong danh sách trên pallet khớp với số lượng thực tế được bàn giao → Bấm Xác nhận và tạo phiếu.\n - Bước 5: Tài xế kéo phiếu & Update thông tin phiếu mới thành công → Lấy hàng đúng đủ số lượng pallet trên PO.\n - Bước 6: Hệ thống gửi BBBG cho Shop",
    "content_html": "<strong>🕋 Vận hành theo vật chứa :</strong>\n - <u><strong>Bước 1:</strong></u> Sau khi tạo PO thành công → TX thao tác in ‘<em>mã Pallet’</em> bằng cách click chọn <code>In mã Pallet</code>.\n - <u><strong>Bước 2:</strong></u> Chọn loại mã cần in.\n  + Pallet của khách hàng:\n   • TX chọn <code>Mã Pallet đối tác</code> và <code>nhập số lượng</code>.\n  + Pallet G ( GHTK ):\n   • TX chọn <code>Mã Pallet của GHTK</code> → Chọn <code>mã pallet</code> từ danh sách.\n*<em> </em><u><em>Lưu ý :</em></u><em>  Dùng pallet của đối tác khi đối tác bàn giao hàng hóa kèm cả pallet. Dùng của GHTK khi đối tác có nhu cầu vận chuyển và gia cố nhưng không có pallet.</em>\n - <u><strong>Bước 3:</strong></u> Gán <code>Sản phẩm</code> lên pallet:\n   • Chọn <code>Gán Pallet</code> → <code>Chọn PO cần gán</code> → Chọn <code>Sản Phẩm</code> cần gán vào pallet ( Có thể chọn tất cả ) → <code>Scan mã pallet</code> → Nhập <code>SL gán</code> → Chọn <code>Xác nhận</code> → popup <code>Gán pallet thành công</code> → <code>Ok</code>\n* <u><em>Lưu ý:</em></u><em> Thao tác Gán Pallet có thể thực hiện tại điểm lấy hàng (bởi TX , người hỗ trợ TX) hoặc tại Hub (bởi XLHH) , tuỳ vào vận hành thực tế.</em>\n - <u><strong>Bước 4:</strong></u> Kiểm tra lại thông tin sản phẩm trong danh sách trên pallet khớp với số lượng thực tế được bàn giao → Bấm <code>Xác nhận</code> và <code>tạo phiếu</code>.\n - <u><strong>Bước 5:</strong></u> Tài xế <code>kéo phiếu</code> & <code>Update</code> thông tin phiếu mới thành công → Lấy hàng đúng đủ số lượng pallet trên PO.\n - <u><strong>Bước 6:</strong></u> Hệ thống gửi BBBG cho Shop"
